import React from "react";

const NewProjects = props => {
  return (
    <section className="project-container">
      <ProjectCard
        className="r1 c3"
        projectImage={inspectionDashScreenshot}
        projectTitle="Manufacturing Dashboard"
        projectDetails="An manufacturing inspection dashboard that displays real-time results, trending, graphical analysis, and alerts."
        projectSkills={[
          "React.js",
          "Web Sockets",
          "amCharts",
          "JavaScript",
          "CSS"
        ]}
      />
      <div className="r3 c3  center-proj">COMPLETED WORKS</div>
      <div className="r2 c2  right-diagonal"></div>
      <div className="r2 c4  left-diagonal"></div>
    </section>
  );
};

export default NewProjects;
